import React from "react";
import { useNavigate } from "react-router-dom";
import "./HospitalDoctorSelection.css";

const hospitals = [
  { id: 1, name: "City Hospital" },
  { id: 2, name: "Green Valley Clinic" },
  { id: 3, name: "Sunrise Medical Center" },
];

const HospitalSelection = () => {
  const navigate = useNavigate();

  const selectHospital = (id) => {
    navigate(`/doctors?hospital=${id}`);
  };

  return (
    <div className="selection-container">
      <h2>Select a Hospital</h2>
      <div className="card-container">
        {hospitals.map((hospital) => (
          <div
            key={hospital.id}
            className="selection-card"
            onClick={() => selectHospital(hospital.id)}
          >
            {hospital.name}
          </div>
        ))}
      </div>
    </div>
  );
};

export default HospitalSelection;
